import { useState } from 'react';
import './Project1.css';
import ArrowRightAltIcon from '@mui/icons-material/ArrowRightAlt';

const Project1 = () => {

    return (
        <header className='header4_Project1'>
            <div className='container'>
                <div className='row'>
                    <div className='header_content4'>
                        <h1>WE ARE TRANSPARENT, AND SO IS OUR PROCESS</h1>
                        <p>Our process is simple, reliable, and available to customers. We provide access to all the necessary project tools and constantly communicate with each other. A Scrum-based workflow allows us to cooperate efficiently, even with time-zone differences between our team and clients.</p>
                    </div>
                </div>
                <div className='header_button'>LOOK AT HOW WE WORK</div>

                <div className='header5'>
                    <div className='header_content5'>
                        <h2>We have specified a set of proven and flexible technologies that allow us to create functional apps of any complexity from scratch. And that is how we do our thing.</h2>
                        <h1>REACT, NODE.JS, GRAPHQL, TYPESCRIPT, DJANGO, FASTAPI, PYTHON, ELASTICSEARCH, AWS, KUBERNETES, POSTGRESQL, MONGODB, CYPRESS</h1>
                    </div>
                </div>

                <div className='header_button_Home2'>MORE ON HOW WE ORGANIZE WORK</div>

            </div>

        </header >
    );
};

export default Project1;
